import React, { Component } from "react";
import Logo from "./Logo";
import AlertInfo from "../Thongbao/AlertInfo";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import { AuthUserContext } from "../Session";

const HeaderBase = () => (
  <AuthUserContext.Consumer>
    {authUser =>
      authUser ? <NavigationAuth authUser={authUser} /> : <NavigationNonAuth />
    }
  </AuthUserContext.Consumer>
);

const NavigationAuth = ({ authUser }) => (
  <>
    <li className="nav-item dropdown u-pro">
      <a
        className="nav-link dropdown-toggle waves-effect waves-dark profile-pic"
        href="javascript:avoid(0)"
        data-toggle="dropdown"
        aria-haspopup="true"
        aria-expanded="false"
      >
        <img src="../assets/images/users/1.jpg" alt="user" />{" "}
        <span className="hidden-md-down">
          THTV &nbsp;
          <br />
        </span>{" "}
      </a>
    </li>
    <li className="nav-item dropdown u-pro">
      <Link to="/sign-out" className="nav-link fa fa-sign-out">
        Sign Out
      </Link>
    </li>
  </>
);

const NavigationNonAuth = () => (
  <>
    <li className="nav-item dropdown u-pro">
      <Link to="/sign-up" className="nav-link">
        Sign Up{" "}
      </Link>
    </li>

    <li className="nav-item dropdown u-pro">
      <Link to="/sign-in" className="nav-link">
        Sign In{" "}
      </Link>
    </li>
  </>
);
class Header extends Component {
  showdata = () => {
    if (this.props.trangthaithongbao === true) {
      return <AlertInfo />;
    }
  };

  render() {
    return (

      <header className="topbar">
        {this.showdata()}
        <nav class="navbar navbar-expand-md navbar-light bg-white shadow-sm">
    <div class="container">
        <a class="navbar-brand" href="{{ url('/') }}">
            THTV
        </a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="{{ __('Toggle navigation') }}">
            <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav mr-auto">
                <li class="nav-item">
                    <a class="nav-link" href="{{ route('login') }}">Home</a>
                </li>

                <li class="nav-item">
                    <a class="nav-link" href="{{ route('blog.index">Blog</a>
                </li>

                <li class="nav-item">
                    <a class="nav-link" href="{{ route('login">About</a>
                </li>

                <li class="nav-item">
                    <a class="nav-link" href="{{ route('login">Contact</a>
                </li>
            </ul>

            <ul class="navbar-nav ml-auto">
                    <li class="nav-item dropdown">
                        <a id="navbarDropdown" class="nav-link dropdown-toggle" href="#" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false" v-pre>
                            Member <span class="caret"></span>
                        </a>
                    </li>

                    <li class="nav-item dropdown">
                        <a id="navbarDropdown" class="nav-link dropdown-toggle" href="#" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false" v-pre>
                            USERNAME <span class="caret"></span>
                        </a>

                        <div class="dropdown-menu dropdown-menu-right" aria-labelledby="navbarDropdown">
                            <a class="dropdown-item" href="{{ route('logout') }}"
                               onclick="event.preventDefault();
                                             document.getElementById('logout-form').submit();">
                                Logout
                            </a>

                            <form id="logout-form" action="{{ route('logout') }}" method="POST" style="display: none;">
                            </form>
                        </div>
                    </li>
            </ul>
        </div>
    </div>
</nav>
